import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './Bookings.css';

const Bookings = () => {
  const [bookedCars, setBookedCars] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/api/cars')
      .then((res) => res.json())
      .then((data) => {
        const filtered = data.filter(car => car.status && car.status === 'booked');
        setBookedCars(filtered);

      })
      .catch((err) => {
        console.error('Error fetching cars:', err);

      });
  }, []);

  return (
    <div className="container">
      <h1 className="title">My Bookings</h1>
      {bookedCars.length === 0 ? (
        <div className="empty">No booked cars found.</div>
      ) : (
        <div className="grid">
          {bookedCars.map((car) => (
            <Link to={`/car/${car._id}`} className="card" key={car._id}>
              <img
                className="image"
                src={`http://localhost:5000${car.images && car.images.length > 0 ? car.images[0] : ''}`}
                alt={car.title}
              />
              <div className="card-content">
                <h2 className="car-title">{car.title}</h2>
                <div className="details">{car.brand} {car.model} ({car.year})</div>
                <div className="price">â‚¹{car.price.toLocaleString('en-IN')}</div>
              </div>
            </Link>
          ))}
        </div>
      )}
    </div>
  );
};

export default Bookings;
